import React from "react";
import { Header } from "./Components/Header/Index.js";
import { BrowserRouter as Router } from "react-router-dom";
import { Pages } from "./Components/Products/Pages.js" 
import 'boxicons';

function App() {
  return (
    <div className="App">
      <Router>
      <Header/>
      <Pages></Pages>
      </Router>
    </div>
  );
}

export default App;
